import React from 'react';
import { Row, Col, Form } from 'react-bootstrap';

function TalentItem({ talent, onChange }) {
  return (
    <Row className="mt-2 align-items-center">
      <Col md={1}>
        <Form.Check 
          type="checkbox" 
          checked={talent.isSelected} 
          onChange={(e) => onChange('isSelected', e.target.checked)}
        />
      </Col>
      <Col>{talent.name}</Col>
      <Col>
        <Form.Control
          type="text"
          value={talent.contractDuration}
          placeholder="Contract Duration"
          onChange={(e) => onChange('contractDuration', e.target.value)}
        />
      </Col>
      <Col>
        <Form.Control
          type="text"
          value={talent.billRate}
          placeholder="Bill Rate"
          onChange={(e) => onChange('billRate', e.target.value)}
        />
      </Col>
      <Col>
        <Form.Control
          as="select"
          value={talent.currency}
          onChange={(e) => onChange('currency', e.target.value)}
        >
          <option value="">Select Currency</option>
          <option value="USD">USD - Dollars ($)</option>
          {/* Add more currency options as needed */}
        </Form.Control>
      </Col>
      {/* Render fields for Standard Time BR, Over Time BR, etc. */}
    </Row>
  );
}

export default TalentItem;
